import React from "react";
import "./navbar.css";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <div>
      <header class="header">
        <div class="nav-left">
          <li>
            <Link to="home">
              <img src="/eventlylogo.svg" alt="evently logo" />
            </Link>
          </li>
          <li>Evently</li>
        </div>
        <div class="nav-right ml-auto">
          <ul>
            <li>
              <PositionedLink
                to="loginPage.js"
                left={!route.customType || route.customType.left}
              >
                Log In
              </PositionedLink>
            </li>
            <li>
              <Link to="signupPage.js">Sign Up</Link>
            </li>
            <li>
              <Link to="Profile.js">
                <img src="/profilelogo.svg" alt="profile" />
              </Link>
            </li>
          </ul>
        </div>
      </header>
    </div>
  );
};
const PositionedLink = styled(Link)`
  position: relative;
  float: ${(props) => (props.left ? "left" : "right")};
  display: inline-block;
`;
export default Navbar;
